// src/components/StatsCarousel.js
import React from "react";
import Slider from "react-slick";
import './Numbercount.css';


const cards = [
  {
    title: "1294",
    subtitle: "Sixes",
    bg: "linear-gradient(to right, #0f2027, #2c5364)",
  },
  {
    title: "2008",
    subtitle: "Winners RAJASTHAN ROYALS",
    image: "/images/rajasthan.png", // Replace with actual path or URL
    bg: "linear-gradient(to right, #ff758c, #ff7eb3)",
  },
  {
    title: "9",
    subtitle: "Hundreds",
    bg: "linear-gradient(to right, #2193b0, #6dd5ed)",
  },
  {
    title: "Sai Sudharsan",
    subtitle: "Orange Cap",
    details: ["Total Runs: 759", "Strike Rate: 156.17", "Matches: 15"],
    image: "/images/sai.png", // Replace with actual path or URL
    bg: "linear-gradient(to right, #ff8008, #ffc837)",
  },
  {
    title: "Chennai Super Kings",
    subtitle: "FairPlay",
    details: ["Points: 143"],
    image: "/images/dhoni.png", // Replace with actual path or URL
    bg: "linear-gradient(to right, #56ccf2, #2f80ed)",
  },
];

const Numbercount = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 600,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: true,
    responsive: [
      {
        breakpoint: 1024,
        settings: { slidesToShow: 2 },
      },
      {
        breakpoint: 768,
        settings: { slidesToShow: 1 },
      },
    ],
  };

  return (
    <div className="carousel-container">
      <Slider {...settings}>
        {cards.map((card, index) => (
          <div key={index}>
            <div className="card" style={{ background: card.bg }}>
              {card.image && (
                <img src={card.image} alt="icon" className="card-image" />
              )}
              <h2>{card.title}</h2>
              <h4>{card.subtitle}</h4>
              {card.details &&
                card.details.map((line, i) => <p key={i}>{line}</p>)}
            </div>
          </div>
        ))}
      </Slider>
    </div>
  );
};

export default Numbercount;
